; loc_1188:
PalToCRAM:
		move	#$2700,sr
		move.w	#0,(Hint_flag).w
		movem.l	a0-a1,-(sp)
		lea	($C00000).l,a1
		lea	($FFFFFA80).w,a0	; load palette from RAM
		move.l	#$C0000000,4(a1)	; set VDP to write to CRAM address $00
	rept 32
		move.l	(a0)+,(a1)		; move palette to CRAM (all 64 colors at once)
	endr
		move.w	#$8A00+223,4(a1)		; write %1101 %1111 to register 10 (interrupt every 224th line)
		movem.l	(sp)+,a0-a1
		tst.b	(Do_Updates_in_H_int).w
		bne.s	loc_11F8
		rte
; ===========================================================================

loc_11F8:
		clr.b	(Do_Updates_in_H_int).w
		movem.l	d0-a6,-(sp)
		bsr.w	Do_Updates
		jsr	(sub_71B4C).l
		movem.l	(sp)+,d0-a6
		rte

; ---------------------------------------------------------------------------
; Subroutine to initialize joypads
; ---------------------------------------------------------------------------
; =============== S U B	R O U T	I N E =======================================


JoypadInit:
		stopZ80
		moveq	#$40,d0
		move.b	d0,(HW_Port_1_Control).l
		move.b	d0,(HW_Port_2_Control).l
		move.b	d0,(HW_Expansion_Control).l
		startZ80
		rts
; End of function JoypadInit

; ---------------------------------------------------------------------------
; Subroutine to read joypad input, and send it to the RAM
; ---------------------------------------------------------------------------
; =============== S U B	R O U T	I N E =======================================


ReadJoypads:
		lea	($FFFFF604).w,a0	; address where joypad states are written
		lea	(HW_Port_1_Data).l,a1	; first joypad port
		bsr.s	Joypad_Read		; do the first joypad
		addq.w	#2,a1			; do the second joypad

Joypad_Read:
		move.b	#0,(a1)
		nop
		nop
		move.b	(a1),d0
		lsl.b	#2,d0
		andi.b	#$C0,d0
		move.b	#$40,(a1)
		nop
		nop
		move.b	(a1),d1
		andi.b	#$3F,d1
		or.b	d1,d0
		not.b	d0
		move.b	(a0),d1
		eor.b	d0,d1
		move.b	d0,(a0)+
		and.b	d0,d1
		move.b	d1,(a0)+
		rts
; End of function ReadJoypads


