		andi.w	#$FF,d0
		add.w	d0,d0
		addi.w	#$80,d0
		move.w	Sine_Data(pc,d0.w),d1 ; cos
		subi.w	#$80,d0
		move.w	Sine_Data(pc,d0.w),d0 ; sin
		rts
; End of function CalcSine

